import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import React from "react";
import PersonalTicket from "./ticket/PersonalTicket";
import Navbar from "./components/Navs";
import Login from "./auth/Login";
import Signup from "./auth/Signup";
import MondayDashboard from "./dashboard/MondayDashboard";
import Dashboard from "./components/Dashboard";
function App() {
  return (
      <div className="App">
        <BrowserRouter>
            <Routes>
              <Route path="/" element={<Navbar />} />
              <Route path="/home" element={<Navbar />} />
              <Route path="/monday" element={<Navbar />} />
              <Route path="/login" element={<Login />} />
              <Route path="/signup" element={<Signup />} />
              <Route path="/analytics" element={<MondayDashboard />} />
              <Route path="/ticket/:id" element={<PersonalTicket editMode={true} />} />
            </Routes>
        </BrowserRouter>
      </div>
  );
}

export default App;
